import { createSlice } from "@reduxjs/toolkit";

export const userSlice = createSlice({
  name: "users",
  initialState: {
    value: {
      reservations: [
        {
          id: 111,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 222,
          reserved: false,
          whoreservet: "",
          selected: true,
        },
        {
          id: 333,
          reserved: true,
          whoreservet: "Andrius",
          selected: false,
        },
        {
          id: 444,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 555,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 666,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 777,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 888,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 999,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
      ],
    },
  },
  reducers: {
    changeSelected: (state, action) => {
      state.value.reservations.selected = action.payload;
    },
    changeName: (state, action) => {
      state.value.reservations.whoreservet = action.payload;
    },
  },
});
export const { changeSelected } = userSlice.actions;

export default userSlice.reducer;
